import React from 'react';
import img from './body.jpg';
import './Boddy.css';

const Body = () => {
  return (
    <>
    <div className='body'>
        <div className='image'>
            <img src={img}/>
        </div>
        <div className='text'>
            <h3>Wellcome to</h3>
        </div>
    </div>
    
    
    </>
  )
}

export default Body
